import React from 'react';
import './coin.css';

const Coin = ({
  name,
  price,
  symbol,
  marketcap,
  volume,
  image,
  priceChange
}) => {
  return (
    <div>


    <div className='coin-container'>
      <img src={image} />
      <h1>{name}</h1>
      <h1>{symbol}</h1>
      <p>${price}</p>
      <p>{volume}</p>
      <p>{priceChange}%</p>
      <p>{marketcap}</p>
    </div>

    </div>
  );
};

export default Coin;
